INSERT INTO `rainlab_translate_messages` (`id`, `code`, `message_data`) VALUES
(1, 'dfm.groupe', '{"x":"DFM Groupe","en":"DFM Group","vn":"DFM"}'),
(2, 'développement.logiciel', '{"x":"D\\u00e9veloppement logiciel","en":"Software development","vn":"Ph\\u00e1t tri\\u1ec3n ph\\u1ea7n m\\u1ec1m"}'),
(3, 'dfm.est.un.groupe.proposant.des.activités.et.des.services.en.développement.logiciel.ingénierie.scientifique.et.informatique.au.cœur.des.enjeux.de.nos.clients.dans.une.relation.de.proximité.nos.experts.assisté.de.notre.centre.de.développement.en.asie....', '{"x":"DFM est un groupe proposant des activit\\u00e9s et des services en d\\u00e9veloppement logiciel, ing\\u00e9nierie scientifique et informatique. Au c\\u0153ur des enjeux de nos clients, dans une relation de proximit\\u00e9, nos experts assist\\u00e9 de notre centre de d\\u00e9veloppement en Asie accompagne les PME et grands comptes dans de nombreux secteurs et dans une large gamme de services :","en":"DFM is a group offering activities and services in software development, scientific and computer engineering","vn":"DFM cung c\\u1ea5p c\\u00e1c d\\u1ecbch v\\u1ee5 ph\\u00e1t tri\\u1ec3n ph\\u1ea7n m\\u1ec1m, t\\u01b0 v\\u1ea5n k\\u1ef9 thu\\u1eadt v\\u00e0 c\\u00f4ng ngh\\u1ec7 th\\u00f4ng tin"}'),
(4, 'web.applications.logiciels.systèmes.connectésembarqués', '{"x":"Web-applications, logiciels & syst\\u00e8mes connect\\u00e9s\\/embarqu\\u00e9s","en":"Web-app, software & connected\\/embedded systems","vn":"Web \\u1ee9ng d\\u1ee5ng, Ph\\u1ea7n m\\u1ec1m v\\u00e0 h\\u1ec7 th\\u1ed1ng c\\u00e1c thi\\u1ebft b\\u1ecb t\\u1ef1 \\u0111\\u1ed9ng"}'),
(5, 'dfm.propose.une.solution.globale.permettant.dassurer.le.développement.de.votre.outil.informatique.dédié.connecté.à.votre.environnement.propre.serveur.smartphone.etc.des.systèmes.connectésembarqués.peuvent.également.la.compléter', '{"x":"DFM propose une solution globale permettant d\\u2019assurer le d\\u00e9veloppement de votre outil informatique d\\u00e9di\\u00e9, connect\\u00e9 \\u00e0 votre environnement propre (serveur, smartphone etc). Des syst\\u00e8mes connect\\u00e9s\\/embarqu\\u00e9s peuvent \\u00e9galement la compl\\u00e9ter.","en":"DFM offers a global solution to ensure the development of your dedicated IT tool, connected to your own environment (server, smartphone etc). Connected \\/ embedded systems can also complement it.","vn":"DFM \\u0111\\u1ec1 xu\\u1ea5t gi\\u1ea3i ph\\u00e1p to\\u00e0n di\\u1ec7n \\u0111\\u1ec3 \\u0111\\u1ea3m b\\u1ea3o s\\u1ef1 ph\\u00e1t tri\\u1ec3n c\\u1ee7a c\\u00e1c c\\u00f4ng c\\u1ee5 c\\u00f4ng ngh\\u1ec7 th\\u00f4ng tin chuy\\u00ean d\\u1ee5ng c\\u1ee7a kh\\u00e1ch h\\u00e0ng, k\\u1ebft n\\u1ed1i v\\u1edbi m\\u00f4i tr\\u01b0\\u1eddng s\\u1eb5n c\\u00f3 c\\u1ee7a kh\\u00e1ch h\\u00e0ng (m\\u00e1y ch\\u1ee7, \\u0111i\\u1ec7n tho\\u1ea1i th\\u00f4ng minh, vv). H\\u1ec7 th\\u1ed1ng c\\u00e1c thi\\u1ebft b\\u1ecb t\\u1ef1 \\u0111\\u1ed9ng c\\u0169ng c\\u00f3 th\\u1ec3 b\\u1ed5 sung nh\\u1eb1m ho\\u00e0n thi\\u1ec7n gi\\u1ea3i ph\\u00e1p."}'),
(6, 'réalité.virtuelle', '{"x":"R\\u00e9alit\\u00e9 Virtuelle","en":"Virtual Reality","vn":"C\\u00f4ng ngh\\u1ec7 th\\u1ef1c t\\u1ebf \\u1ea3o"}'),
(7, 'la.vr.comme.outil.au.quotidien', '{"x":"La VR comme outil au quotidien","en":"New RV tool","vn":"Th\\u1ef1c t\\u1ebf \\u1ea3o-C\\u00f4ng c\\u1ee5 m\\u1edbi"}'),
(8, 'dfm.dispose.des.compétences.rd.dingénierie.qui.lui.permette.de.vous.proposer.des.expériences.vr.à.partir.doutils.existants.ou.développés.sur.mesure', '{"x":"DFM dispose des comp\\u00e9tences R&D, d''ing\\u00e9nierie qui lui  permette de vous proposer des exp\\u00e9riences VR \\u00e0 partir d\\u2019outils existants ou d\\u00e9velopp\\u00e9s sur mesure.","en":"Our R & D and engineering capabilities enable us to offer you VR experiments using existing or customized tools.","vn":"V\\u1edbi n\\u0103ng l\\u1ef1c chuy\\u00ean m\\u00f4n v\\u1ec1 nghi\\u00ean c\\u1ee9u v\\u00e0 ph\\u00e1t tri\\u1ec3n, t\\u01b0 v\\u1ea5n k\\u1ef9 thu\\u1eadt cho ph\\u00e9p ch\\u00fang t\\u00f4i \\u0111\\u1ec1 xu\\u1ea5t cho kh\\u00e1ch h\\u00e0ng nh\\u1eefng tr\\u1ea3i nghi\\u1ec7m tuy\\u1ec7t v\\u1eddi c\\u1ee7a c\\u00f4ng ngh\\u1ec7 th\\u1ef1c t\\u1ebf \\u1ea3o nh\\u1edd v\\u00e0o nh\\u1eefng thi\\u1ebft b\\u1ecb s\\u1eb5n c\\u00f3 v\\u00e0 nh\\u1eefng thi\\u1ebft b\\u1ecb s\\u1ebd \\u0111\\u01b0\\u1ee3c ph\\u00e1t tri\\u1ec3n theo nhu c\\u1ea7u c\\u1ee7a th\\u1ecb tr\\u01b0\\u1eddng"}'),
(9, 'ingénierie.technique.scientifique', '{"x":"Ing\\u00e9nierie technique & scientifique","en":"Scientific & Technical Engineering","vn":"T\\u01b0 v\\u1ea5n k\\u1ef9 thu\\u1eadt v\\u00e0 c\\u00f4ng ngh\\u1ec7"}'),
(10, 'calculs.scientifiques.dédiés', '{"x":"Calculs scientifiques d\\u00e9di\\u00e9s","en":"Dedicated scientific approach","vn":"T\\u01b0 v\\u1ea5n k\\u1ef9 thu\\u1eadt"}'),
(11, 'de.la.mécanique.conception.validation.à.la.mécanique.des.fluides.tout.en.intégrant.les.couplages.complexes.dfm.se.positionne.comme.un.interlocuteur.privilégié.aéronautique.défense.transport.énergie.en.apportant.une.réponse.dédiée.et.experte', '{"x":"De la m\\u00e9canique (conception- validation) \\u00e0 la m\\u00e9canique des fluides tout en int\\u00e9grant les couplages complexes, DFM se positionne comme un interlocuteur privil\\u00e9gi\\u00e9 (a\\u00e9ronautique, d\\u00e9fense, transport, \\u00e9nergie, \\u2026) en apportant une r\\u00e9ponse d\\u00e9di\\u00e9e et experte.","en":"DFM is positioned as a privileged interlocutor (aeronautics, defense, transport, energy, ...) by providing a dedicated and expert response from mechanical (design-validation) to fluid mechanics while integrating complex couplings.","vn":"T\\u00ednh to\\u00e1n s\\u1ee9c b\\u1ec1n (thi\\u1ebft k\\u1ebf- ki\\u1ec3m duy\\u1ec7t), \\u0111\\u1ed9ng l\\u1ef1c h\\u1ecdc l\\u01b0u ch\\u1ea5t, DFM l\\u00e0 chuy\\u00ean gia trong c\\u00e1c l\\u0129nh v\\u1ef1c c\\u00f4ng nghi\\u1ec7p \\u0111\\u1eb7c th\\u00f9 (h\\u00e0ng kh\\u00f4ng v\\u0169 tr\\u1ee5, qu\\u1ed1c ph\\u00f2ng, giao th\\u00f4ng v\\u1eadn t\\u1ea3i, n\\u0103ng l\\u01b0\\u1ee3ng, ...)."}'),
(12, 'nos.valeurs', '{"x":"Nos valeurs","en":"Our values","vn":"Gi\\u00e1 tr\\u1ecb c\\u1ed1t l\\u00f5i"}'),
(13, 'dfm.est.un.groupe.proposant.des.activités.et.des.services.en.développement.logiciel.ingénierie.scientifique.et.informatique', '{"x":"DFM est un groupe proposant des activit\\u00e9s et des services en d\\u00e9veloppement logiciel, ing\\u00e9nierie scientifique et informatique","en":"DFM is a group providing services in software development, scientific and computer engineering. At the heart of the stakes of our customers, in a close relationship, our experts assisted by our development center in Asia are close to SMEs and large accounts in many sectors and in a wide range of services: ","vn":"DFM-Engineering l\\u00e0 c\\u00f4ng ty t\\u01b0 v\\u1ea5n k\\u1ef9 thu\\u1eadt v\\u00e0 vi\\u1ebft ph\\u1ea7n m\\u1ec1m. \\u0110\\u1ed9i ng\\u0169 chuy\\u00ean gia c\\u1ee7a ch\\u00fang t\\u00f4i lu\\u00f4n s\\u00e1t c\\u00e1nh c\\u00f9ng kh\\u00e1ch h\\u00e0ng nh\\u1eb1m mang \\u0111\\u1ebfn cho kh\\u00e1ch h\\u00e0ng c\\u00e1c gi\\u1ea3i ph\\u00e1p nhanh ch\\u00f3ng, hi\\u1ec7u qu\\u1ea3, s\\u1ef1 \\u0111\\u1ed5i m\\u1edbi trong c\\u00e1c d\\u1ecbch v\\u1ee5 c\\u00f4ng nghi\\u1ec7p. Ch\\u00fang t\\u00f4i h\\u1ed7 tr\\u1ee3 s\\u1ef1 ph\\u00e1t tri\\u1ec3n cho c\\u00e1c doanh nghi\\u1ec7p t\\u1eeb doanh nghi\\u1ec7p v\\u1eeba v\\u00e0 nh\\u1ecf \\u1edf Ch\\u00e2u \\u00c1 cho \\u0111\\u1ebfn c\\u00e1c c\\u00f4ng ty l\\u1edbn ho\\u1ea1t \\u0111\\u1ed9ng trong nhi\\u1ec1u l\\u0129nh v\\u1ef1c v\\u00e0 trong m\\u1ed9t lo\\u1ea1t c\\u00e1c d\\u1ecbch v\\u1ee5:"}'),
(14, 'qualité.de.service', '{"x":"Qualit\\u00e9 de service","en":"Outstanding service","vn":"Ch\\u1ea5t l\\u01b0\\u1ee3ng d\\u1ecbch v\\u1ee5"}'),
(15, '100.de.nos.clients.satisfaits', '{"x":"100% de nos clients satisfaits","en":"100% of clients satisfied","vn":"100% s\\u1ef1 h\\u00e0i l\\u00f2ng c\\u1ee7a kh\\u00e1ch h\\u00e0ng"}'),
(16, 'une.présence.internationale', '{"x":"Une pr\\u00e9sence internationale","en":"International","vn":"M\\u1ea1ng l\\u01b0\\u1edbi qu\\u1ed1c t\\u1ebf"}'),
(17, 'france.espagne.vietnam.brésil', '{"x":"France, Espagne, Vietnam, Br\\u00e9sil","en":"France, Espagne, Vietnam, Br\\u00e9sil","vn":"Ph\\u00e1p, T\\u00e2y Ban Nha, Vi\\u1ec7t Nam, Brasil"}'),
(18, 'sécurité.optimisée', '{"x":"S\\u00e9curit\\u00e9 Optimis\\u00e9e","en":"Optimal security","vn":"T\\u00ednh b\\u1ea3o m\\u1eadt"}'),
(19, 'échanges.de.données100.securisee', '{"x":"\\u00c9changes de donn\\u00e9es100% se\\u0301curise\\u0301e","en":"Secured data exchange ","vn":"Trao \\u0111\\u1ed5i d\\u1eef li\\u1ec7u an to\\u00e0n 100%"}'),
(20, 'adaptabilité', '{"x":"Adaptabilit\\u00e9","en":"Adaptability","vn":"Gi\\u00e1 tr\\u1ecb m\\u00e0 ch\\u00fang t\\u00f4i mang l\\u1ea1i"}'),
(21, 'ergonomie.et.design.sont.les.cles.dun.outil.intuitif.et.a.usage.facilite', '{"x":"Ergonomie et design sont les cle\\u0301s d''un outil intuitif et a\\u0300 usage facilite\\u0301","en":"Ergonomics and design are the keys to an intuitive and easy-to-use tool","vn":"T\\u01b0\\u01a1ng th\\u00edch v\\u00e0 thi\\u1ebft k\\u1ebf \\u0111\\u1ed3 h\\u1ecda l\\u00e0 ch\\u00eca kh\\u00f3a c\\u1ee7a c\\u00f4ng c\\u1ef1 tr\\u1ef1c quan v\\u00e0 d\\u1ec5 s\\u1eed d\\u1ee5ng"}'),
(22, 'le.logiciel.est.un.maillon.essentiel.et.son.développement.optimisé.doit.être.accompagné.de.performance.de.qualité.et.de.rentabilité.pour.cela.nos.équipes.mettent.en.applications.les.méthodes.agiles.et.en.y.intégrant.les.règles.métiers.pour.vous.aider...', '{"x":"Le logiciel est un maillon essentiel et son d\\u00e9veloppement optimis\\u00e9 doit \\u00eatre accompagn\\u00e9 de performance, de qualit\\u00e9 et de rentabilit\\u00e9. Pour cela, nos \\u00e9quipes mettent en applications les m\\u00e9thodes agiles et en y int\\u00e9grant les r\\u00e8gles m\\u00e9tiers pour vous aider \\u00e0 relever ces d\\u00e9fis et d\\u00e9velopper des logiciels \\u00e9volutifs, s\\u00e9curis\\u00e9es et facilement d\\u00e9ployable dans des temps r\\u00e9dults. Nous offrons des services logiciels qui couvrent toutes les \\u00e9tapes du cycle de vie du produit de la conceptualisation \\u00e0 la maintenance et de la documentation.","en":"Software is the today\\u2019s essential link and its optimized development must be accompanied by performance, quality and profitability. To do this, our teams develop agile methods to integrating business rules as well as scalablity, secured and easily deployable software in redundant times. We offer software services that cover all steps of the life cycle product from scratch up  to maintenance.","vn":"L\\u00e0m th\\u1ebf n\\u00e0o \\u0111\\u1ec3 v\\u1eeba t\\u1ed1i \\u01b0u h\\u00f3a trong vi\\u1ec7c ph\\u00e1t tri\\u1ec3n ph\\u1ea7n m\\u1ec1m v\\u1eeba mang l\\u1ea1i hi\\u1ec7u su\\u1ea5t v\\u00e0 l\\u1ee3i nhu\\u1eadn ? \\u0110\\u1ec3 l\\u00e0m \\u0111\\u01b0\\u1ee3c \\u0111i\\u1ec1u \\u0111\\u00f3, \\u0111\\u1ed9i ng\\u0169 chuy\\u00ean gia c\\u1ee7a ch\\u00fang t\\u00f4i \\u00e1p d\\u1ee5ng c\\u00e1c ph\\u01b0\\u01a1ng ph\\u00e1p linh ho\\u1ea1t v\\u00e0 k\\u1ebft h\\u1ee3p v\\u1edbi nh\\u1eefng nghi\\u1ec7p v\\u1ee5 chuy\\u00ean m\\u00f4n \\u0111\\u1ec3 gi\\u00fap kh\\u00e1ch h\\u00e0ng gi\\u1ea3i quy\\u1ebft nh\\u1eefng kh\\u00f3 kh\\u0103n v\\u00e0 ph\\u00e1t tri\\u1ec3n ph\\u1ea7n m\\u1ec1m m\\u1edf r\\u1ed9ng, an to\\u00e0n v\\u00e0 d\\u1ec5 d\\u00e0ng tri\\u1ec3n khai trong th\\u1eddi gian s\\u1edbm nh\\u1ea5t. Ch\\u00fang t\\u00f4i cung c\\u1ea5p c\\u00e1c d\\u1ecbch v\\u1ee5 ph\\u1ea7n m\\u1ec1m, \\u0111\\u01b0a ra gi\\u1ea3i ph\\u00e1p t\\u1ed5ng th\\u1ec3 cho c\\u00e1c d\\u1ef1 \\u00e1n c\\u1ee7a kh\\u00e1ch h\\u00e0ng, t\\u1eeb vi\\u1ec7c \\u0111\\u00e1p \\u1ee9ng c\\u00e1c y\\u00eau c\\u1ea7u k\\u1ef9 thu\\u1eadt cho \\u0111\\u1ebfn c\\u00e1c d\\u1ecbch v\\u1ee5 b\\u1ea3o tr\\u00ec v\\u00e0 so\\u1ea1n th\\u1ea3o c\\u00e1c t\\u00e0i li\\u1ec7u."}'),
(23, 'application.mobile', '{"x":"Application Mobile","en":"Application Mobile","vn":"\\u1ee8ng d\\u1ee5ng di \\u0111\\u1ed9ng"}'),
(24, 'la.création.dapplications.mobiles.repose.sur.une.méthode.adaptée.à.la.mobilité.qui.place.lexpérience.utilisateur.au.centre.du.cycle.de.production.lergonomie.de.lapplication.est.primordiale.comme.lest.également.sa.comptatibilité.platforme.iphone.ipad....', '{"x":"La cr\\u00e9ation d\\u2019applications mobiles repose sur une m\\u00e9thode adapt\\u00e9e \\u00e0 la mobilit\\u00e9 qui place l\\u2019exp\\u00e9rience utilisateur au centre du cycle de production.  L\\u2019ergonomie de l\\u2019application est primordiale comme l\\u2019est \\u00e9galement sa comptatibilit\\u00e9 platforme (iPhone, iPad, tablettes, smartphones Android et smartphones Windows Phone\\u2026)","en":"Mobile application development is based on a dedicated to mobility that places the user experience at the center of the production cycle. Ergonomy of the application is paramount as is also its compatibility platform (iPhone, iPad, tablets, Android smartphones and Windows Phone smartphones ...)","vn":"T\\u1ea1o ra c\\u00e1c \\u1ee9ng d\\u1ee5ng di \\u0111\\u1ed9ng c\\u00f3 th\\u1ec3 ch\\u1ea1y tr\\u00ean c\\u00e1c d\\u00f2ng \\u0111i\\u1ec7n tho\\u1ea1i kh\\u00e1c nhau thay v\\u00ec ch\\u1ec9 ch\\u00fa tr\\u1ecdng v\\u00e0o m\\u1ed9t d\\u00f2ng \\u0111i\\u1ec7n tho\\u1ea1i nh\\u01b0 kinh nghi\\u1ec7m s\\u1eed d\\u1ee5ng c\\u1ee7a ng\\u01b0\\u1eddi d\\u00f9ng t\\u1eeb tr\\u01b0\\u1edbc t\\u1edbi nay. S\\u1ef1 th\\u00edch \\u1ee9ng cho nhi\\u1ec1u lo\\u1ea1i thi\\u1ebft b\\u1ecb c\\u1ee7a \\u1ee9ng d\\u1ee5ng l\\u00e0 \\u0111i\\u1ec1u c\\u1ea7n thi\\u1ebft c\\u0169ng l\\u00e0 n\\u1ec1n t\\u1ea3ng t\\u01b0\\u01a1ng th\\u00edch c\\u1ee7a n\\u00f3 (iPhone, iPad, m\\u00e1y t\\u00ednh b\\u1ea3ng, \\u0111i\\u1ec7n tho\\u1ea1i c\\u00f3 h\\u1ec7 \\u0111i\\u1ec1u h\\u00e0nh Android v\\u00e0 h\\u1ec7 \\u0111i\\u1ec1u h\\u00e0nh Windows\\u2026)"}'),
(25, 'logiciel.dédié', '{"x":"Logiciel d\\u00e9di\\u00e9","en":"Dedicated Software","vn":"Ph\\u1ea7n m\\u1ec1m chuy\\u00ean d\\u1ee5ng"}'),
(26, 'dfm.prend.en.compte.toutes.les.étapes.de.la.réalisation.de.votre.logiciel.de.la.rédaction.du.cahier.des.charges.jusquà.la.hot.line.nos.équipes.logiciel.proposent.des.services.personnalisés.des.solutions.de.qualité.avec.des.tarifs.attractifs', '{"x":"DFM prend en compte toutes les \\u00e9tapes de la r\\u00e9alisation de votre logiciel, de la r\\u00e9daction du cahier des charges jusqu\\u2019\\u00e0 la hot-line. Nos \\u00e9quipes \\u00ab\\u00a0Logiciel\\u00a0\\u00bb proposent des services personnalis\\u00e9s, des solutions de qualit\\u00e9 avec des tarifs attractifs.","en":"DFM takes into account all the stages of the realization of your software, from the drafting of the specifications to the hot-line. Our \\"Software\\" teams offer personalized services, quality solutions with attractive rates","vn":"DFM cung c\\u1ea5p t\\u1ea5t c\\u1ea3 c\\u00e1c giai \\u0111o\\u1ea1n v\\u00e0 c\\u00e1c b\\u01b0\\u1edbc ph\\u00e1t tri\\u1ec3n ph\\u1ea7n m\\u1ec1m cho kh\\u00e1ch h\\u00e0ng, t\\u1eeb vi\\u1ec7c \\u0111\\u00e1p \\u1ee9ng c\\u00e1c y\\u00eau c\\u1ea7u k\\u1ef9 thu\\u1eadt cho \\u0111\\u1ebfn c\\u00e1c d\\u1ecbch v\\u1ee5 h\\u1ed7 tr\\u1ee3 tr\\u1ef1c tuy\\u1ebfn cho kh\\u00e1ch h\\u00e0ng. Ch\\u00fang t\\u00f4i \\u0111\\u1ec1 xu\\u1ea5t nh\\u1eefng thi\\u1ebft k\\u1ebf ri\\u00eang ph\\u00f9 h\\u1ee3p v\\u1edbi ti\\u00eau ch\\u00ed v\\u00e0 mong mu\\u1ed1n c\\u1ee7a kh\\u00e1ch h\\u00e0ng, c\\u00e1c gi\\u1ea3i ph\\u00e1p v\\u1ec1 ch\\u1ea5t l\\u01b0\\u1ee3ng v\\u1edbi gi\\u00e1 c\\u1ea3 ph\\u00f9 h\\u1ee3p nh\\u1ea5t.  "}'),
(27, 'a.titre.dexemple.dfm.développe.intègre.et.maintient.le.logiciel.vitrages.décision.ginger.cebtp.depuis.plus.de.10ans.au.delà.des.qualités.requises.en.informatique.la.maîtrise.de.la.physique.dédiée.aux.vitrages.a.permis.un.développement.des.plus.effica...', '{"x":"A titre d''exemple, DFM d\\u00e9veloppe, Int\\u00e8gre et maintient le logiciel Vitrages D\\u00e9cision, GINGER CEBTP, depuis plus de 10ans. Au-del\\u00e0 des qualit\\u00e9s requises en informatique, la ma\\u00eetrise de la physique d\\u00e9di\\u00e9e aux vitrages a permis un d\\u00e9veloppement des plus efficaces.","en":"As an example, DFM develops, integrates and maintains the VD Glazing Decisions software, GINGER CEBTP, for more than 10 years. Beyond the qualities required in computer science, the dedicated physics to glazing is also controlled and managed by our engineering team providing a hight effective development as well.","vn":"V\\u00ed d\\u1ee5: Ph\\u1ea7n m\\u1ec1m v\\u1ec1 k\\u00ednh Vitrages D\\u00e9cision t\\u00ednh to\\u00e1n ri\\u00eang cho t\\u1eadp \\u0111o\\u00e0n GINGER CEBTP \\u0111\\u00e3 \\u0111\\u01b0\\u1ee3c ph\\u00e1t tri\\u1ec3n v\\u00e0 b\\u1ea3o tr\\u00ec h\\u01a1n 10 n\\u0103m nay b\\u1edfi \\u0111\\u1ed9i ng\\u0169 c\\u1ee7a ch\\u00fang t\\u00f4i. Nh\\u1edd v\\u00e0o nh\\u1eefng k\\u1ef9 n\\u0103ng v\\u1ec1 c\\u00f4ng ngh\\u1ec7 th\\u00f4ng tin, k\\u1ef9 thu\\u1eadt c\\u01a1 h\\u1ecdc d\\u00e0nh ri\\u00eang cho t\\u00ednh to\\u00e1n k\\u00ednh c\\u1ee7a DFM \\u0111\\u00e3 cho ph\\u00e9p ph\\u00e1t tri\\u1ec3n ph\\u1ea7n m\\u1ec1m t\\u00ednh to\\u00e1n n\\u00e0y m\\u1ed9t c\\u00e1ch hi\\u1ec7u qu\\u1ea3 h\\u01a1n."}'),
(28, 'les.outils.net.visual.basic.net.c.net.java.cc.fortran.delphi.opengl.direct3d', '{"x":"Les outils: .NET (Visual Basic.Net, C#.Net,\\u2026), JAVA, C\\/C++, Fortran, Delphi, OpenGL, Direct3D\\u2026","en":"The tools: .NET (Visual Basic.Net, C # .Net, ...), JAVA, C \\/ C ++, Fortran, Delphi, OpenGL, Direct3D ...","vn":"C\\u00f4ng c\\u1ee5 h\\u1ed7 tr\\u1ee3: NET (Visual Basic.Net, C # .Net, ...), JAVA, C \\/ C ++, Fortran, Delphi, OpenGL, Direct3D ..."}'),
