(30, 'la.disponibilité.de.vos.systèmes.informatiques.est.indispensable.à.votre.activité.et.linfogérance.site.internet.hors.fonctionnement.un.service.de.courriels.non.disponible.une.faille.de.sécurité.exploitée.par.un.utilisateur.malveillant.une.complexité....', '{"x":"La disponibilit\\u00e9 de vos syst\\u00e8mes informatiques est indispensable \\u00e0 votre activit\\u00e9 et l\\u2019infog\\u00e9rance (site internet hors fonctionnement, un service de courriels non disponible, une faille de s\\u00e9curit\\u00e9 exploit\\u00e9e par un utilisateur malveillant, une complexit\\u00e9 des serveurs linux de stockages et de calculs HPC, \\u2026) est la solution qui vous s\\u00e9duit mais pas les tarifs pratiqu\\u00e9s par les soci\\u00e9t\\u00e9s d\\u2019infog\\u00e9rance? ","en":"The availability of your IT systems is essential to your business and IT outsourcing business (non-functioning website, unavailable e-mail service, attacker exploit a potential vulnerability, complexity of linux storage and HPC computers, ...) is an attractive solution but not the rates usually charged by outsourcing companies? Call us and change your mind about IT outsourcing business.","vn":"D\\u1ecbch v\\u1ee5 gia c\\u00f4ng ph\\u1ea7n m\\u1ec1m c\\u1ee7a chung t\\u00f4i s\\u1ebd gi\\u00fap cho h\\u1ec7 th\\u1ed1ng c\\u00f4ng ngh\\u1ec7 th\\u00f4ng tin c\\u1ee7a kh\\u00e1ch h\\u00e0ng lu\\u00f4n trong t\\u00ecnh tr\\u1ea1ng t\\u1ed1t nh\\u1ea5t. Ch\\u00fang t\\u00f4i \\u0111\\u01b0a ra gi\\u1ea3i ph\\u00e1p gi\\u00fap kh\\u00e1ch h\\u00e0ng kh\\u1eafc ph\\u1ee5c h\\u00e0ng lo\\u1ea1t c\\u00e1c v\\u1ea5n \\u0111\\u1ec1 (trang web kh\\u00f4ng ho\\u1ea1t \\u0111\\u1ed9ng \\u0111\\u01b0\\u1ee3c, d\\u1ecbch v\\u1ee5 th\\u01b0 \\u0111i\\u1ec7n t\\u1eed kh\\u00f4ng s\\u1eed d\\u1ee5ng \\u0111\\u01b0\\u1ee3c, l\\u1ed7 h\\u1ed5ng b\\u1ea3o m\\u1eadt \\u0111\\u01b0\\u1ee3c khai th\\u00e1c b\\u1edfi ng\\u01b0\\u1eddi d\\u00f9ng nguy hi\\u1ec3m, s\\u1ef1 ph\\u1ee9c t\\u1ea1p c\\u1ee7a h\\u1ec7 th\\u1ed1ng m\\u00e1y ch\\u1ee7 linux v\\u00e0 c\\u00e1c t\\u00ednh to\\u00e1n tr\\u00ean h\\u1ec7 th\\u1ed1ng m\\u00e1y t\\u00ednh c\\u00f4ng su\\u1ea5t cao,\\u2026) m\\u00e0 kh\\u00f4ng t\\u00ednh m\\u1ee9c gi\\u00e1 nh\\u01b0 \\u0111\\u01b0\\u1ee3c \\u0111\\u01b0a ra b\\u1edfi m\\u1ed9t c\\u00f4ng ty gia c\\u00f4ng ph\\u1ea7n m\\u1ec1m? H\\u00e3y li\\u00ean h\\u1ec7 v\\u1edbi ch\\u00fang t\\u00f4i v\\u00e0 thay \\u0111\\u1ed5i suy ngh\\u0129 v\\u1ec1 gia c\\u00f4ng ph\\u1ea7n m\\u1ec1m"}'),
