(32, 'système.connecté.amp.embarqué', '{"x":"Syst\\u00e8me connect\\u00e9 &amp; embarqu\\u00e9","en":"Connected & embedded system","vn":"H\\u1ec7 th\\u1ed1ng c\\u00e1c thi\\u1ebft b\\u1ecb t\\u1ef1 \\u0111\\u1ed9ng"}'),
(33, 'architecture.des.systèmes.embarqués.systèmes.de.stockage.gestion.des.communications.et.des.réseaux.à.partir.de.la.constitution.de.circuits.intégrés.gestion.des.architectures.de.systèmes.à.grande.échelle.centres.de.données.cloud.computing.réseaux.et.s...', '{"x":"Architecture des syst\\u00e8mes embarqu\\u00e9s, syst\\u00e8mes de stockage, gestion des communications et des r\\u00e9seaux \\u00e0 partir de la constitution de circuits int\\u00e9gr\\u00e9s. Gestion des architectures de syst\\u00e8mes \\u00e0 grande \\u00e9chelle - centres de donn\\u00e9es, cloud computing, r\\u00e9seaux et syst\\u00e8mes distribu\\u00e9s, grid computing.","en":"Architecture of embedded systems, storage systems, management of communications and networks from the constitution of integrated circuits. Management of large-scale systems architectures - data centers, cloud computing, networks and distributed systems, grid computing. ","vn":"X\\u00e2y d\\u1ef1ng c\\u00e1c h\\u1ec7 th\\u1ed1ng nh\\u00fang, h\\u1ec7 th\\u00f4ng l\\u01b0u tr\\u1eef, b\\u1ed9 nh\\u1edb, th\\u00f4ng tin li\\u00ean l\\u1ea1c v\\u00e0 h\\u1ec7 th\\u1ed1ng k\\u1ebft n\\u1ed1i m\\u1ea1ng tr\\u00ean c\\u00e1c chip \\u0111i\\u1ec7n t\\u1eed. X\\u00e2y d\\u1ef1ng c\\u00e1c h\\u1ec7 th\\u1ed1ng c\\u00f3 quy m\\u00f4 l\\u1edbn - trung t\\u00e2m d\\u1eef li\\u1ec7u, \\u0111i\\u1ec7n to\\u00e1n \\u0111\\u00e1m m\\u00e2y, m\\u1ea1ng v\\u00e0 h\\u1ec7 th\\u1ed1ng ph\\u00e2n ph\\u1ed1i, t\\u00ednh to\\u00e1n l\\u01b0\\u1edbi \\u2026  "}'),
(34, 'intégration.dune.large.gamme.darchitectures.cpu.x86.x86.64.arm.ppc.avr.pic.i8051.risc.avec.possibilité.de.technologies.bluetooth.wifi.rf.gsm.3g4g.dfm.intégre.lensemble.de.la.chaine.de.la.conception.du.prototype.jusquà.la.livraison.de.la.série', '{"x":"Int\\u00e9gration d\\u2019une large gamme d''architectures CPU: x86, x86_64, ARM, PPC, AVR, PIC, i8051, RISC avec possibilit\\u00e9 de technologies bluetooth, wifi, RF, GSM, 3G\\/4G. DFM int\\u00e9gre l\\u2019ensemble de la chaine, de la conception du prototype jusqu\\u2019\\u00e0 la livraison de la s\\u00e9rie.","en":"Integration of a wide range of CPU architectures: x86, x86_64, ARM, PPC, AVR, PIC, i8051, with the possibility of RISC Bluetooth, wifi, RF, GSM, 3G \\/ 4G. DFM integrates the entire chain, from prototype design to delivery of the series.","vn":"L\\u00e0m vi\\u1ec7c v\\u1edbi m\\u1ed9t lo\\u1ea1t c\\u00e1c c\\u1ea5u tr\\u00fac CPU: x86, x86_64, ARM, PPC, AVR, PIC, i8051, RISC. C\\u00f4ng ngh\\u1ec7 t\\u00edch h\\u1ee3p truy\\u1ec1n d\\u1eef li\\u1ec7u kh\\u00f4ng d\\u00e2y\\/ truy\\u1ec1n th\\u00f4ng m\\u00e0 ch\\u00fang t\\u00f4i c\\u00f3 th\\u1ec3 \\u1ee9ng d\\u1ee5ng trong c\\u00e1c thi\\u1ebft b\\u1ecb t\\u00edch h\\u1ee3p: bluetooth, wifi, \\u1ee9ngRF, GSM, 3G \\u2026"}'),
(35, 'conception.et.développement.dapi.par.des.procédures.sécurisées.restful.oauth.v2.json.xml.yaml.les.technologies.intégrées.plus.avancées.sont.également.proposées.gps.gsm.sms.rf.bluetooth.ublox.microchip.gps.puces.zigbee.rf.modules.gsm', '{"x":"Conception et d\\u00e9veloppement d''API par des proc\\u00e9dures s\\u00e9curis\\u00e9es (Restful, OAUTH v2, JSON, XML, YAML\\u2026). Les technologies int\\u00e9gr\\u00e9es plus avanc\\u00e9es sont \\u00e9galement propos\\u00e9es: GPS, GSM, SMS, RF, BlueTooth, Ublox microchip GPS, Puces Zigbee RF, Modules GSM.","en":"Design and development of API by secured procedures (Restful, OAUTH v2, JSON, XML, YAML ...). More advanced integrated technologies are also proposed: GPS, GSM, SMS, RF, BlueTooth, Ublox microchip GPS, Zigbee RF chips, GSM modules. ","vn":"Thi\\u1ebft k\\u1ebf v\\u00e0 ph\\u00e1t tri\\u1ec3n giao di\\u1ec7n l\\u1eadp tr\\u00ecnh API b\\u1edfi c\\u00e1c quy tr\\u00ecnh b\\u1ea3o \\u0111\\u1ea3m v\\u00e0 \\u0111\\u00e1ng tin c\\u1eady nh\\u01b0: Restful, OAUTH v2, JSON, XML, YAML. C\\u00f4ng ngh\\u1ec7 t\\u00edch h\\u1ee3p ti\\u00ean ti\\u1ebfn nh\\u1ea5t nh\\u01b0: GPS, GSM, SMS, RF, BlueTooth, Ublox microchip GPS, Puces Zigbee RF, Modules GSM."}'),
(36, 'la.réalité.virtuelle.assure.la.reproduction.dun.environnement.réel.ou.imaginaire.et.simule.présence.et.lenvironnement.physique.dun.utilisateur.et.son.interaction.dfm.offre.des.expériences.premium.en.réalité.virtuelle.et.notre.finalité.est.de.proposer...', '{"x":"La r\\u00e9alit\\u00e9 virtuelle assure la reproduction d\\u2019un environnement r\\u00e9el ou imaginaire, et simule pr\\u00e9sence et l''environnement physique d''un utilisateur et son interaction. DFM offre des exp\\u00e9riences premium en r\\u00e9alit\\u00e9 virtuelle et notre finalit\\u00e9 est de proposer les services et les outils  des ing\\u00e9nieurs de demain.","en":"Virtual reality allows user to evolve in a real or imaginary environment and it provides interactions to the user. DFM offers premium experiences in virtual reality. Our goal is to offer services and tools of the tomorrow\\u2019s engineer and tomorrow is now today!","vn":"C\\u00f4ng ngh\\u1ec7 th\\u1ef1c t\\u1ebf \\u1ea3o l\\u00e0 m\\u00f4i tr\\u01b0\\u1eddng m\\u00f4 ph\\u1ecfng c\\u00e1c s\\u1ef1 v\\u1eadt v\\u00e0 hi\\u1ec7n t\\u01b0\\u1ee3ng theo th\\u1eddi gian th\\u1ef1c v\\u00e0 t\\u01b0\\u01a1ng t\\u00e1c v\\u1edbi ng\\u01b0\\u1eddi s\\u1eed d\\u1ee5ng qua t\\u1ed5ng h\\u1ee3p c\\u00e1c k\\u00eanh c\\u1ea3m gi\\u00e1c. DFM mang l\\u1ea1i nh\\u1eefng tr\\u1ea3i nghi\\u1ec7m tuy\\u1ec7t v\\u1eddi trong th\\u1ef1c t\\u1ebf \\u1ea3o v\\u00e0 m\\u1ee5c ti\\u00eau c\\u1ee7a ch\\u00fang t\\u00f4i l\\u00e0 cung c\\u1ea5p c\\u00e1c d\\u1ecbch v\\u1ee5 v\\u00e0 c\\u00e1c c\\u00f4ng c\\u1ee5 k\\u1ef9 thu\\u1eadt trong t\\u01b0\\u01a1ng lai."}'),
(37, 'visite.3d.360', '{"x":"Visite 3D 360\\u00b0","en":"360\\u00b0 3D tour tool","vn":"Tham quan qua 3D 360\\u00b0"}'),
(38, 'capturer.un.environnement.en.3d.et.lexplorer.en.réalité.virtuelle.est.un.challenge.délicat.en.effet.le.contenu.3d.360.reconstruit.à.partir.de.quelques.caméras.disposées.en.sphère.manque.de.profondeur.et.limite.considérablement.la.liberté.de.mouvement...', '{"x":"Capturer un environnement en 3D et l''explorer en r\\u00e9alit\\u00e9 virtuelle est un challenge d\\u00e9licat. En effet, le contenu 3D 360 reconstruit \\u00e0 partir de quelques cam\\u00e9ras dispos\\u00e9es en sph\\u00e8re manque de profondeur et limite consid\\u00e9rablement la libert\\u00e9 de mouvement, pour un co\\u00fbt mat\\u00e9riel tr\\u00e8s \\u00e9lev\\u00e9. A l''inverse, scanner un lieu en 3D \\u00e0 l''aide de scanners, LIDARs ou par photogramm\\u00e9trie est complexe, difficile \\u00e0 mettre en pratique et souffre souvent d''erreurs de reconstruction 3D. Par ailleurs, il est impossible d''afficher les mod\\u00e8les 3D obtenus, tr\\u00e8s complexes, de mani\\u00e8re fluides sur un dispositif VR mobile (Cardboard ou GearVR).","en":"Capturing a 3D environment and exploring it in virtual reality is a delicate challenge. Indeed, the 360 \\u200b\\u200b3D content reconstructed from a few cameras arranged in a sphere lacks depth and greatly limits the freedom of movement for a very high material cost. Conversely, scanning a 3D location using scanners, LIDARs or photogrammetry is complex, difficult to put into practice, and often suffers from 3D reconstruction errors. Moreover, it is impossible to display the highly complex 3D models obtained in a fluid way on a mobile VR device (Cardboard or GearVR).","vn":"Ch\\u1ee5p l\\u1ea1i m\\u00f4i tr\\u01b0\\u1eddng 3D v\\u00e0 kh\\u00e1m ph\\u00e1 ch\\u00fang b\\u1eb1ng c\\u00f4ng ngh\\u1ec7 th\\u1ef1c t\\u1ebf \\u1ea3o l\\u00e0 m\\u1ed9t th\\u00e1ch th\\u1ee9c l\\u1edbn. Tr\\u00ean th\\u1ef1c t\\u1ebf, \\u0111\\u1ec3 ch\\u1ee5p l\\u1ea1i \\u0111\\u01b0\\u1ee3c h\\u00ecnh \\u1ea3nh 3D 360\\u00b0 c\\u1ea7n m\\u1ed9t v\\u00e0i chi\\u1ebfc m\\u00e1y \\u1ea3nh nh\\u01b0ng nh\\u1eefng chi\\u1ebfc m\\u00e1y \\u1ea3nh n\\u00e0y th\\u01b0\\u1eddng thi\\u1ebfu \\u0111\\u1ed9 s\\u00e2u v\\u00e0 h\\u1ea1n ch\\u1ebf \\u0111\\u00e1ng k\\u1ec3 s\\u1ef1 t\\u1ef1 do \\u0111i l\\u1ea1i, v\\u1edbi m\\u1ee9c chi ph\\u00ed thi\\u1ebft b\\u1ecb r\\u1ea5t cao. Ng\\u01b0\\u1ee3c l\\u1ea1i, qu\\u00e9t \\u0111\\u1ecba \\u0111i\\u1ec3m b\\u1eb1ng m\\u00e1y qu\\u00e9t 3D, LIDARs ho\\u1eb7c b\\u1eb1ng ph\\u00e9p quang tr\\u1eafc kh\\u00e1 ph\\u1ee9c t\\u1ea1p, kh\\u00f3 th\\u1ef1c hi\\u1ec7n v\\u00e0 th\\u01b0\\u1eddng xuy\\u00ean b\\u1ecb l\\u1ed7i ph\\u1ea3i d\\u1ef1ng l\\u1ea1i 3D. H\\u01a1n n\\u1eefa, v\\u1edbi c\\u00e1c thi\\u1ebft b\\u1ecb VR cho di \\u0111\\u1ed9ng (k\\u00ednh Google Cardboard hay GearVR) vi\\u1ec7c hi\\u1ec3n th\\u1ecb c\\u00e1c m\\u00f4 h\\u00ecnh 3D th\\u01b0\\u1eddng kh\\u00f4ng th\\u1ec3 th\\u1ef1c hi\\u1ec7n \\u0111\\u01b0\\u1ee3c. "}'),
(39, 'nos.équipes.ont.alors.conçu.un.outil.abordable.simple.à.utiliser.capable.de.capturer.du.contenu.3d.360.statique.compatible.avec.les.plateformes.mobiles.la.génération.actuelle.noffre.pas.de.suivi.de.la.position.dans.lespace.mais.compense.par.des.écran...', '{"x":"Nos \\u00e9quipes ont alors con\\u00e7u un outil abordable, simple \\u00e0 utiliser, capable de capturer du contenu 3D 360 statique, compatible avec les plateformes mobiles. La g\\u00e9n\\u00e9ration actuelle n''offre pas de suivi de la position dans l''espace, mais compense par des \\u00e9crans haute-r\\u00e9solution : le contenu se doit donc d''\\u00eatre tr\\u00e8s haute r\\u00e9solution \\u00e9galement, st\\u00e9r\\u00e9o, mais ne n\\u00e9cessite pas de donn\\u00e9es volum\\u00e9triques","en":"Our teams then designed an affordable, easy-to-use tool capturing 3D 360-static content  compatible with all mobile platforms. The current generation does not offer position tracking in space, but compensates by high resolution screens: the content must therefore be very high resolution also, stereo, but does not require volumetric data","vn":"V\\u00ec v\\u1eady \\u0111\\u1ed9i ng\\u0169 c\\u1ee7a ch\\u00fang t\\u00f4i thi\\u1ebft k\\u1ebf m\\u1ed9t c\\u00f4ng c\\u1ee5 v\\u1edbi gi\\u00e1 c\\u1ea3 ph\\u1ea3i ch\\u0103ng, d\\u1ec5 s\\u1eed d\\u1ee5ng, c\\u00f3 kh\\u1ea3 n\\u0103ng ch\\u1ee5p 3D 360 n\\u1ed9i dung t\\u0129nh, t\\u01b0\\u01a1ng th\\u00edch v\\u1edbi nhi\\u1ec1u n\\u1ec1n t\\u1ea3ng di \\u0111\\u1ed9ng. Phi\\u00ean b\\u1ea3n hi\\u1ec7n t\\u1ea1i kh\\u00f4ng cung c\\u1ea5p theo d\\u00f5i v\\u1ecb tr\\u00ed trong kh\\u00f4ng gian, nh\\u01b0ng b\\u00f9 l\\u1ea1i \\u0111\\u1ed9 ph\\u00e2n gi\\u1ea3i c\\u1ee7a m\\u00e0n h\\u00ecnh cao: n\\u1ed9i dung c\\u1ea7n hi\\u1ec3n th\\u1ecb c\\u00f3 \\u0111\\u1ed9 ph\\u00e2n gi\\u1ea3i r\\u1ea5t cao, \\u00e2m thanh stereo, trong khi \\u0111\\u00f3 kh\\u00f4ng nh\\u1ea5t thi\\u1ebft ph\\u1ea3i c\\u00f3 d\\u1eef li\\u1ec7u th\\u1ec3 t\\u00edch"}'),
(40, 'visite.vr.temps.réel', '{"x":"Visite VR temps r\\u00e9el","en":"VR real time tour","vn":"Th\\u1ef1c t\\u1ebf t\\u0103ng c\\u01b0\\u1eddng"}'),
(41, 'en.temps.réel.limmersion.est.évidemment.piloté.par.linteraction.et.lenjeu.est.de.gérer.qualité.graphique.et.temps.au.mieux.larchitecture.de.nos.outils.sattache.toujours.à.optimiser.ces.deux.paramètres.en.fonction.de.leffet.recherché', '{"x":"En temps r\\u00e9el, l\\u2019immersion est \\u00e9videmment pilot\\u00e9 par l\\u2019interaction et l\\u2019enjeu est de g\\u00e9rer qualit\\u00e9 graphique et temps au mieux. L\\u2019architecture de nos outils s\\u2019attache toujours \\u00e0 optimiser ces deux param\\u00e8tres en fonction de l\\u2019effet recherch\\u00e9.","en":"In real time, immersion is obviously driven by interaction and the challenge is to manage graphic quality and time at best. The architecture of our tools always strives to optimize these two parameters according to the desired effect.","vn":"Th\\u00e1ch th\\u1ee9c \\u0111\\u1eb7t ra \\u0111\\u1ec3 ng\\u01b0\\u1eddi d\\u00f9ng c\\u00f3 c\\u1ea3m gi\\u00e1c th\\u1ef1c s\\u1ef1 \\u0111\\u01b0\\u1ee3c \\u0111\\u1eafm ch\\u00ecm nh\\u01b0 trong th\\u1eddi gian th\\u1ef1c v\\u00e0 c\\u00f3 th\\u1ec3 t\\u01b0\\u01a1ng t\\u00e1c l\\u00e0 l\\u00e0m sao \\u0111\\u1ec3 qu\\u1ea3n l\\u00fd \\u0111\\u01b0\\u1ee3c ch\\u1ea5t l\\u01b0\\u1ee3ng \\u0111\\u1ed3 h\\u1ecda v\\u00e0 th\\u1eddi gian m\\u1ed9t c\\u00e1ch t\\u1ed1t nh\\u1ea5t.   B\\u1eb1ng nh\\u1eefng c\\u00f4ng c\\u1ee5 c\\u00f4ng ngh\\u1ec7 hi\\u1ec7n \\u0111\\u1ea1i, ch\\u00fang t\\u00f4i cam k\\u1ebft t\\u1ed1i \\u01b0u h\\u00f3a hai th\\u00f4ng s\\u1ed1 n\\u00e0y tu\\u1ef3 thu\\u1ed9c v\\u00e0o hi\\u1ec7u \\u1ee9ng m\\u00e0 kh\\u00e1ch h\\u00e0ng mong mu\\u1ed1n. "}'),
(42, 'le.développement.doutils.virtuels.assure.un.pilotage.ergonomique.et.précis.de.lapplication.et.nos.équipes.rd.travaillent.pour.une.qualité.optimale.de.la.visite.à.partir.dune.interaction.des.différentes.techniques.entre.elles', '{"x":"Le d\\u00e9veloppement d\\u2019outils virtuels assure un pilotage ergonomique et pr\\u00e9cis de l\\u2019application et nos \\u00e9quipes R&D travaillent pour une qualit\\u00e9 optimale de la visite \\u00e0 partir d\\u2019une interaction des diff\\u00e9rentes techniques entre elles.","en":"The development of virtual tools ensures an ergonomic and accurate management of the application and our R & D teams work for an optimal quality of the visit from an interaction of the different techniques between them.","vn":"S\\u1ef1 ph\\u00e1t tri\\u1ec3n c\\u00e1c c\\u00f4ng c\\u1ee5 \\u1ea3o \\u0111\\u1ea3m b\\u1ea3o vi\\u1ec7c ki\\u1ec3m so\\u00e1t c\\u00e1ch th\\u1ee9c t\\u1ed5 ch\\u1ee9c h\\u1ee3p l\\u00fd v\\u00e0 ch\\u00ednh x\\u00e1c c\\u1ee7a c\\u00e1c \\u1ee9ng d\\u1ee5ng, k\\u1ebft h\\u1ee3p v\\u1edbi \\u0111\\u1ed9i ng\\u0169 nghi\\u00ean c\\u1ee9u v\\u00e0 ph\\u00e1t tri\\u1ec3n c\\u1ee7a ch\\u00fang t\\u00f4i lu\\u00f4n c\\u1ed1 g\\u1eafng nh\\u1eb1m t\\u1ed1i \\u01b0u ch\\u1ea5t l\\u01b0\\u1ee3ng khi kh\\u00e1ch h\\u00e0ng tham quan t\\u1eeb s\\u1ef1 t\\u01b0\\u01a1ng t\\u00e1c gi\\u1eefa c\\u00e1c c\\u00f4ng ngh\\u1ec7 kh\\u00e1c nhau. "}'),
(43, 'outils.conception.vr', '{"x":"Outils conception VR","en":"Our VR customised conception","vn":"C\\u00f4ng c\\u1ee5 thi\\u1ebft k\\u1ebf th\\u1ef1c t\\u1ebf \\u1ea3o"}'),
(44, 'en.tant.quingénieurs.notre.but.ultime.est.de.concevoir.de.nouvelles.perspectives.dans.les.outils.de.développement.et.de.conception.imaginez.par.exemple.une.conception.avec.une.véritable.boite.à.outil.concevez.finalisez.testez.et.partagez.vos.concepti...', '{"x":"En tant qu\\u2019ing\\u00e9nieurs, notre but ultime est de concevoir de nouvelles perspectives dans les outils de d\\u00e9veloppement et de conception. Imaginez par exemple une conception avec une v\\u00e9ritable boite \\u00e0 outil. Concevez, finalisez, testez et partagez vos conceptions d\\u2019un seul clic! De plus, l\\u2019introduction des r\\u00e8gles m\\u00e9tiers assure une r\\u00e9alisation des plans de conception directement.","en":"As engineers, our ultimate goal is to design new perspectives in development and design tools. Imagine, for example, a design with a real toolbox. Design, finalize, test and share your designs in a single click! In addition, the introduction of business rules ensures realization of design plans directly. VR-assisted design is a reality to reduce the cycle of development in relation to all your company services: marketing, development, research, manufacturing,","vn":"L\\u00e0 chuy\\u00ean gia trong l\\u0129nh v\\u1ef1c k\\u1ef9 thu\\u1eadt, m\\u1ee5c ti\\u00eau cu\\u1ed1i c\\u00f9ng c\\u1ee7a ch\\u00fang t\\u00f4i l\\u00e0 ph\\u00e1t tri\\u1ec3n nh\\u1eefng g\\u00f3c nh\\u00ecn m\\u1edbi trong vi\\u1ec7c ph\\u00e1t tri\\u1ec3n v\\u00e0 thi\\u1ebft k\\u1ebf c\\u00e1c c\\u00f4ng c\\u1ee5. H\\u00e3y t\\u01b0\\u1edfng t\\u01b0\\u1ee3ng v\\u1edbi v\\u00ed d\\u1ee5 thi\\u1ebft k\\u1ebf m\\u1ed9t h\\u1ed9p c\\u00f4ng c\\u1ee5 th\\u1ef1c s\\u1ef1. T\\u1ea5t c\\u1ea3 c\\u00e1c c\\u00f4ng \\u0111o\\u1ea1n th\\u1ef1c hi\\u1ec7n nh\\u01b0 thi\\u1ebft k\\u1ebf, ho\\u00e0n thi\\u1ec7n, ki\\u1ec3m tra v\\u00e0 chia s\\u1ebb thi\\u1ebft k\\u1ebf ch\\u1ec9 v\\u1edbi m\\u1ed9t c\\u00e1i nh\\u1ea5p chu\\u1ed9t duy nh\\u1ea5t c\\u1ee7a b\\u1ea1n! Ngo\\u00e0i ra, v\\u1edbi n\\u0103ng l\\u1ef1c chuy\\u00ean m\\u00f4n \\u0111\\u1ea3m b\\u1ea3o c\\u00e1c b\\u1ea3n v\\u1ebd thi\\u1ebft k\\u1ebf tr\\u1ef1c ti\\u1ebfp s\\u1ebd \\u0111\\u01b0\\u1ee3c th\\u1ef1c hi\\u1ec7n.  Vi\\u1ec7c thi\\u1ebft k\\u1ebf \\u0111\\u01b0\\u1ee3c h\\u1ed7 tr\\u1ee3 b\\u1edfi c\\u00f4ng ngh\\u1ec7 th\\u1ef1c t\\u1ebf \\u1ea3o, \\u0111i\\u1ec1u n\\u00e0y s\\u1ebd gi\\u00fap gi\\u1ea3m thi\\u1ec3u \\u0111\\u00e1ng k\\u1ec3 chi ph\\u00ed cho c\\u00f4ng ty c\\u1ee7a b\\u1ea1n nh\\u01b0 chi ph\\u00ed cho vi\\u1ec7c ph\\u00e1t tri\\u1ec3n c\\u00e1c c\\u00f4ng c\\u1ee5 hay c\\u00e1c d\\u1ecbch v\\u1ee5 kh\\u00e1c c\\u1ee7a c\\u00f4ng ty b\\u1ea1n: marketing, ph\\u00e1t tri\\u1ec3n, nghi\\u00ean c\\u1ee9u, s\\u1ea3n xu\\u1ea5t\\u2026"}'),
(46, 'réalité.augmentée', '{"x":"R\\u00e9alit\\u00e9 Augment\\u00e9e","en":"Augmented Reality ","vn":"Th\\u1ef1c t\\u1ebf t\\u0103ng c\\u01b0\\u1eddng"}'),
(47, 'la.réalité.augmentée.permet.dinclure.en.temps.réel.des.informations.texte.vidéo.photo.image.animées.2d.ou.3d.en.surimposition.de.la.réalité.et.de.manière.interactive', '{"x":"La r\\u00e9alit\\u00e9 augment\\u00e9e permet d\\u2019inclure en temps r\\u00e9el des informations (texte, vid\\u00e9o, photo, image anim\\u00e9es, 2D ou 3D\\u2026) en surimposition de la r\\u00e9alit\\u00e9 et de mani\\u00e8re interactive. ","en":"Augmented reality makes it possible to include in real time information (text, video, photo, animated image, 2D or 3D ...) in superimposition of reality and interactively.","vn":"Th\\u1ef1c t\\u1ebf t\\u0103ng c\\u01b0\\u1eddng l\\u00e0 c\\u00f4ng ngh\\u1ec7 cho ph\\u00e9p b\\u1ed5 sung th\\u00f4ng tin theo th\\u1eddi gian th\\u1ef1c (v\\u0103n b\\u1ea3n, video, h\\u00ecnh \\u1ea3nh, \\u1ea3nh \\u0111\\u1ed9ng, h\\u00ecnh \\u1ea3nh 2D hay 3D\\u2026), th\\u00eam c\\u00e1c v\\u1eadt \\u1ea3o v\\u00e0o th\\u1ef1c t\\u1ebf v\\u00e0 v\\u00e0o c\\u00e1c t\\u01b0\\u01a1ng t\\u00e1c. "}'),
(48, 'les.applications.sont.infinies.et.lensemble.des.domaines.industrie.tourisme.formation.rd.va.être.impacté.nos.experts.sont.à.votre.écoute.pour.développer.la.vôtre', '{"x":"Les applications sont infinies et l\\u2019ensemble des domaines  (industrie, tourisme, formation, R&D, \\u2026) va \\u00eatre impact\\u00e9. Nos experts sont \\u00e0 votre \\u00e9coute pour d\\u00e9velopper la v\\u00f4tre...","en":"Applications are endless and all the domains (industry, tourism, training, R & D, ...) will be impacted. Our experts are at your disposal to develop yours.","vn":"C\\u00f4ng ngh\\u1ec7 n\\u00e0y \\u0111\\u01b0\\u1ee3c \\u1ee9ng d\\u1ee5ng trong h\\u1ea7u h\\u1ebft c\\u00e1c l\\u0129nh v\\u1ef1c (c\\u00f4ng nghi\\u1ec7p, du l\\u1ecbch, \\u0111\\u00e0o t\\u1ea1o, nghi\\u00ean c\\u1ee9u v\\u00e0 ph\\u00e1t tri\\u1ec3n\\u2026). \\u0110\\u1ed9i ng\\u0169 chuy\\u00ean gia c\\u1ee7a ch\\u00fang t\\u00f4i lu\\u00f4n l\\u1eafng nghe \\u0111\\u1ec3 ph\\u00e1t tri\\u1ec3n theo mong mu\\u1ed1n c\\u1ee7a kh\\u00e1ch h\\u00e0ng."}'),
(49, 'loffre.en.ingénierie.scientifique.technique.de.dfm.sadresse.aux.clients.des.secteurs.industriels.aéronautique.spatial.transport.terrestre.énergie.naval.nucléaire.dfm.se.positionne.comme.votre.interlocuteur.privilégié.en.apportant.des.réponses.experte...', '{"x":"L\\u2019offre en ing\\u00e9nierie scientifique & technique de DFM s\\u2019adresse aux clients des secteurs industriels (a\\u00e9ronautique, spatial, transport terrestre, \\u00e9nergie, naval, nucl\\u00e9aire, \\u2026). DFM se positionne comme votre interlocuteur privil\\u00e9gi\\u00e9 en apportant des r\\u00e9ponses expertes. Acteur en recherche fondamentale et appliqu\\u00e9e, la qualit\\u00e9 de nos prestations n\\u2019en est que mieux renforc\\u00e9e.","en":"DFM is positioned as a privileged interlocutor (aeronautics, defense, transport, energy, ...) by providing a dedicated and expert response from mechanical (design-validation) to fluid mechanics while integrating complex couplings.","vn":"DFM cung c\\u1ea5p c\\u00e1c d\\u1ecbch v\\u1ee5 t\\u01b0 v\\u1ea5n k\\u1ef9 thu\\u1eadt. Kh\\u00e1ch h\\u00e0ng c\\u1ee7a ch\\u00fang t\\u00f4i \\u0111\\u01b0\\u1ee3c tr\\u1ea3i r\\u1ed9ng \\u1edf nhi\\u1ec1u l\\u0129nh v\\u1ef1c c\\u00f4ng nghi\\u1ec7p (h\\u00e0ng kh\\u00f4ng, v\\u0169 tr\\u1ee5, giao th\\u00f4ng v\\u1eadn t\\u1ea3i, n\\u0103ng l\\u01b0\\u1ee3ng, h\\u00e0ng h\\u1ea3i, h\\u1ea1t nh\\u00e2n\\u2026). DFM c\\u00f3 v\\u1ecb tr\\u00ed nh\\u01b0 m\\u1ed9t nh\\u00e0 \\u0111\\u1ed1i tho\\u1ea1i cho ng\\u00e0nh c\\u00f4ng nghi\\u1ec7p \\u0111\\u1eb7c th\\u00f9. \\u0110\\u00f3ng vai tr\\u00f2 l\\u00e0 nh\\u00e0 nghi\\u00ean c\\u1ee9u ch\\u00ednh v\\u00e0 \\u1ee9ng d\\u1ee5ng, n\\u00e2ng cao ch\\u1ea5t l\\u01b0\\u1ee3ng d\\u1ecbch v\\u1ee5 lu\\u00f4n l\\u00e0 \\u01b0u ti\\u00ean h\\u00e0ng \\u0111\\u1ea7u c\\u1ee7a ch\\u00fang t\\u00f4i."}'),
(50, 'caomaillage', '{"x":"CAO\\/maillage","en":"CAD\\/meshing\\/Pre-treatment","vn":"Thi\\u1ebft k\\u1ebf\\/Chia l\\u01b0\\u1edbi"}'),
(51, 'réduire.les.cycles.de.développement.est.un.enjeu.primordial.et.la.conception.détaillée.permet.dassure.un.développement.de.haute.qualité.tout.en.réduisant.les.coût.et.le.temps.de.fabrication.de.plus.un.management.dédié.et.une.approche.projet.limite.le...', '{"x":"R\\u00e9duire les cycles de d\\u00e9veloppement est un enjeu primordial et la conception d\\u00e9taill\\u00e9e permet d\\u2019assure un d\\u00e9veloppement de haute qualit\\u00e9 tout en r\\u00e9duisant les co\\u00fbt et le temps de fabrication. De plus, un management d\\u00e9di\\u00e9 et une approche projet limite le raisonnement it\\u00e9ratif et permet ainsi d\\u2019acc\\u00e9l\\u00e9rer les d\\u00e9veloppements.","en":"Reducing development cycles is a key issue and the detailed design ensures high quality development while reducing cost and manufacturing time. Moreover, a dedicated management and a project approach limits the iterative reasoning and thus accelerates developments.","vn":"Gi\\u1ea3m chu k\\u1ef3 ph\\u00e1t tri\\u1ec3n l\\u00e0 nhi\\u1ec7m v\\u1ee5 \\u01b0u ti\\u00ean v\\u00e0 thi\\u1ebft k\\u1ebf chi ti\\u1ebft v\\u1eeba c\\u00f3 th\\u1ec3 \\u0111\\u1ea3m b\\u1ea3o s\\u1ef1 ph\\u00e1t tri\\u1ec3n v\\u1edbi ch\\u1ea5t l\\u01b0\\u1ee3ng cao v\\u1eeba gi\\u1ea3m chi ph\\u00ed v\\u00e0 th\\u1eddi gian s\\u1ea3n xu\\u1ea5t. Ngo\\u00e0i ra, vi\\u1ec7c qu\\u1ea3n l\\u00fd mang t\\u00ednh \\u0111\\u1eb7c th\\u00f9 v\\u00e0 c\\u00e1ch ti\\u1ebfp c\\u1eadn d\\u1ef1 \\u00e1n l\\u00e0m h\\u1ea1n ch\\u1ebf s\\u1ef1 l\\u1eb7p \\u0111i l\\u1eb7p l\\u1ea1i v\\u00e0 cho ph\\u00e9p l\\u00e0m t\\u0103ng t\\u1ed1c \\u0111\\u1ed9 ph\\u00e1t tri\\u1ec3n."}'),
(52, 'notre.approche.cao.couvre.la.modélisation.paramétrique.des.composants.les.modélisations.surfacique.et.volumique.nos.offres.incluent.les.dessins.définition.fabrication.les.plans.densemble.les.schémas.électriques.et.dinstrumentation.les.tuyauteries.et....', '{"x":"Notre approche CAO couvre la mod\\u00e9lisation param\\u00e9trique des composants, les mod\\u00e9lisations surfacique et volumique. Nos offres incluent les dessins d\\u00e9finition \\/ fabrication, les plans d''ensemble, les sch\\u00e9mas \\u00e9lectriques et  d''instrumentation, les tuyauteries et les dessins tube de routage. Les pr\\u00e9traitements d\\u00e9di\\u00e9s sont \\u00e9galement propos\\u00e9s pour la plupart des logiciels commerciaux.","en":"Our CAD approach covers parametric component modeling, surface and volume modeling. Our offers include definition \\/ fabrication drawings, overall drawings, electrical schematics and instrumentation, pipework and tube routing drawings. Dedicated preprocessing is also available for most commercial software. ","vn":"Ph\\u01b0\\u01a1ng ph\\u00e1p ti\\u1ebfp c\\u1eadn thi\\u1ebft k\\u1ebf c\\u1ee7a ch\\u00fang t\\u00f4i bao g\\u1ed3m c\\u00e1c m\\u00f4 h\\u00ecnh th\\u00e0nh ph\\u1ea7n tham s\\u1ed1, c\\u00e1c m\\u00f4 h\\u00ecnh b\\u1ec1 m\\u1eb7t v\\u00e0 kh\\u1ed1i l\\u01b0\\u1ee3ng. C\\u00e1c d\\u1ecbch v\\u1ee5 m\\u00e0 ch\\u00fang t\\u00f4i cung c\\u1ea5p g\\u1ed3m c\\u00e1c b\\u1ea3n v\\u1ebd theo quy \\u0111\\u1ecbnh\\/ t\\u1ef1 thi\\u1ebft k\\u1ebf, c\\u00e1c b\\u1ea3n v\\u1ebd t\\u1ed5ng th\\u1ec3, c\\u00e1c s\\u01a1 \\u0111\\u1ed3 \\u0111i\\u1ec7n v\\u00e0 thi\\u1ebft b\\u1ecb, \\u1ed1ng v\\u00e0 c\\u00e1c b\\u1ea3n v\\u1ebd \\u1ed1ng \\u0111\\u1ecbnh tuy\\u1ebfn. C\\u00e1c x\\u1eed l\\u00fd s\\u01a1 b\\u1ed9 \\u0111\\u1eb7c th\\u00f9 th\\u01b0\\u1eddng \\u0111\\u01b0\\u1ee3c \\u0111\\u1ec1 xu\\u1ea5t cho ph\\u1ea7n l\\u1edbn c\\u00e1c ph\\u1ea7n m\\u1ec1m th\\u01b0\\u01a1ng m\\u1ea1i."}'),
(53, 'calcul.scientifique', '{"x":"Calcul scientifique","en":"Dedicated scientific approach","vn":"T\\u00ednh to\\u00e1n s\\u1ee9c b\\u1ec1n"}'),
(54, 'en.mécanique.et.structure.nos.équipes.maîtrisent.les.simulations.à.partir.de.logiciels.commerciaux.et.de.codes.open.source.en.statiquedynamique.linéaire.et.nonlinéaire.modale.et.vibratoire.fatigue.dynamique.rapide', '{"x":"En m\\u00e9canique et structure, nos \\u00e9quipes ma\\u00eetrisent les simulations \\u00e0 partir de logiciels commerciaux et de codes Open source en statique\\/dynamique, lin\\u00e9aire et nonlin\\u00e9aire, modale et vibratoire, fatigue, dynamique rapide..","en":"In mechanics and structure, our teams master the simulations from commercial software to open source codes in static \\/ dynamic, linear and nonlinear, modal and vibration, fatigue, fast dynamics.","vn":"V\\u1edbi d\\u1ecbch v\\u1ee5 t\\u00ednh to\\u00e1n s\\u1ee9c b\\u1ec1n v\\u00e0 k\\u1ebft c\\u1ea5u, \\u0111\\u1ed9i ng\\u0169 c\\u1ee7a ch\\u00fang t\\u00f4i ki\\u1ec3m so\\u00e1t c\\u00e1c m\\u00f4 ph\\u1ecfng t\\u1eeb c\\u00e1c ph\\u1ea7n m\\u1ec1m th\\u01b0\\u01a1ng m\\u1ea1i v\\u00e0 m\\u00e3 ngu\\u1ed3n m\\u1edf cho t\\u00ednh to\\u00e1n t\\u0129nh\\/\\u0111\\u1ed9ng h\\u1ecdc, \\u0111\\u1ed9ng l\\u1ef1c h\\u1ecdc, rung, m\\u1ecfi\\u2026 "}'),
(55, 'dans.les.domaines.fluides.lensemble.des.caractéristiques.de.simulation.découlements.peut.être.conduit.turbulents.compressibles.incompressibles.isothermes.ou.anisothermes.réactifs.avec.réaction.chimique.etou.de.combustion.voire.découlements.diphasique...', '{"x":"Dans les domaines fluides, l\\u2019ensemble des caract\\u00e9ristiques de simulation d\\u2019\\u00e9coulements peut \\u00eatre conduit : turbulents compressibles \\/ incompressibles, isothermes ou anisothermes, r\\u00e9actifs avec r\\u00e9action chimique et\\/ou de combustion, voire d\\u2019\\u00e9coulements diphasiques.","en":"All fluid flow simulation can be carried out: compressible \\/ incompressible, isothermal or anisothermal turbulents, reactive with chemical reaction and \\/ or combustion, or even diphasic flows.","vn":"Trong l\\u0129nh v\\u1ef1c t\\u00ednh to\\u00e1n \\u0111\\u1ed9ng h\\u1ecdc l\\u01b0u ch\\u1ea5t, ch\\u00fang t\\u00f4i th\\u1ef1c hi\\u1ec7n t\\u1ea5t c\\u1ea3 c\\u00e1c m\\u00f4 ph\\u1ecfng d\\u00f2ng ch\\u1ea3y: d\\u00f2ng n\\u00e9n \\u0111\\u01b0\\u1ee3c\\/ kh\\u00f4ng n\\u00e9n \\u0111\\u01b0\\u1ee3c, trao \\u0111\\u1ed5i nhi\\u1ec7t v\\u00e0 d\\u00f2ng nhi\\u1ec1u pha, s\\u1ef1 ch\\u00e1y\\u2026"}'),
(56, 'hpc.codes.dédiés', '{"x":"HPC & codes d\\u00e9di\\u00e9s","en":"HPC & dedicated mathematical software","vn":"HPC v\\u00e0 m\\u00e3 ngu\\u1ed3n \\u0111\\u1eb7c th\\u00f9"}'),
(57, 'lexpertise.scientifique.de.nos.équipes.nous.permet.de.proposer.des.développements.de.codes.scientifiques.adaptés.à.la.demande.de.nos.clients', '{"x":"L\\u2019expertise scientifique de nos \\u00e9quipes nous permet de proposer des d\\u00e9veloppements de codes scientifiques adapt\\u00e9s \\u00e0 la demande de nos clients...","en":"The scientific expertise of our teams allows us to propose development of scientific codes adapted to the demand of our customers ... The advantage is for our partners to have a complete software integrating the exact needs without purchasing expensive licenses.","vn":"V\\u1edbi \\u0111\\u1ed9i ng\\u0169 chuy\\u00ean gia k\\u1ef9 thu\\u1eadt cho ph\\u00e9p ch\\u00fang t\\u00f4i \\u0111\\u1ec1 xu\\u1ea5t ph\\u00e1t tri\\u1ec3n c\\u00e1c code k\\u1ef9 thu\\u1eadt ph\\u00f9 h\\u1ee3p v\\u1edbi y\\u00eau c\\u1ea7u c\\u1ee7a kh\\u00e1ch h\\u00e0ng.   Ch\\u00fang t\\u00f4i mang \\u0111\\u1ebfn cho kh\\u00e1ch h\\u00e0ng m\\u1ed9t ph\\u1ea7n m\\u1ec1m t\\u1ed5ng th\\u1ec3 ph\\u00f9 h\\u1ee3p v\\u1edbi nhu c\\u1ea7u v\\u00e0 gi\\u00fap kh\\u00e1ch h\\u00e0ng ti\\u1ebft ki\\u1ec7m \\u0111\\u01b0\\u1ee3c chi ph\\u00ed t\\u1eeb vi\\u1ec7c c\\u1ea5p ph\\u00e9p b\\u1ea3n quy\\u1ec1n ph\\u1ea7n m\\u1ec1m."}'),
(59, 'un.exemple.réduisez.votre.facture.annuelle.en.logiciel.cfd.par.16.comment.contactez.nous', '{"x":"Un exemple ? R\\u00e9duisez votre facture annuelle en logiciel CFD par 16*\\u2026 comment? Contactez-nous !","en":"An example? Reduced your annual CFD bill by 16 factor without altering quality is possible. Contact us!","vn":"V\\u00ed d\\u1ee5 minh h\\u1ecda: L\\u00e0m th\\u1ebf n\\u00e0o \\u0111\\u1ec3 gi\\u1ea3m h\\u00f3a \\u0111\\u01a1n ph\\u1ea7n m\\u1ec1m CFD h\\u00e0ng n\\u0103m l\\u00e0 16*\\u2026? H\\u00e3y li\\u00ean h\\u1ec7 v\\u1edbi ch\\u00fang t\\u00f4i!"}');
INSERT INTO `rainlab_translate_messages` (`id`, `code`, `message_data`) VALUES
(60, 'vous.voulez.réduire.vos.frais.de.calculs.scientifiques.notre.cloud.hpc.est.à.votre.service.à.prix.coutant', '{"x":"Vous voulez r\\u00e9duire vos frais de calculs scientifiques. Notre cloud HPC est \\u00e0 votre service \\u00e0 prix coutant*","en":"You want to reduce your scientific calculation costs. Our cloud HPC is at your service at attracting cost:  Development of your own soft integrating graphical interfaces, technical documents and management of licenses.","vn":"B\\u1ea1n mu\\u1ed1n gi\\u1ea3m chi ph\\u00ed c\\u1ee7a c\\u00e1c t\\u00ednh to\\u00e1n khoa h\\u1ecdc. C\\u00f4ng ngh\\u1ec7 \\u0111i\\u1ec7n to\\u00e1n \\u0111\\u00e1m m\\u00e2y HPC c\\u1ee7a ch\\u00fang t\\u00f4i s\\u1ebd gi\\u00fap b\\u1ea1n ti\\u1ebft ki\\u1ec7m chi ph\\u00ed *"}'),
(61, 'prestations.rédaction.des.codes.de.calculs.développement.dinterfaces.graphiques.rédaction.des.documents.techniques.gestion.des.licences', '{"x":"Prestations :\\u000bR\\u00e9daction des codes de calculs, d\\u00e9veloppement d\\u2019interfaces graphiques, r\\u00e9daction des documents, techniques, gestion des licences.","en":" ","vn":"D\\u1ecbch v\\u1ee5: Vi\\u1ebft code t\\u00ednh to\\u00e1n, ph\\u00e1t tri\\u1ec3n giao di\\u1ec7n \\u0111\\u1ed3 h\\u1ecda, so\\u1ea1n th\\u1ea3o v\\u0103n b\\u1ea3n, t\\u00ednh to\\u00e1n k\\u1ef9 thu\\u1eadt, qu\\u1ea3n l\\u00fd gi\\u1ea5y ph\\u00e9p."}'),
(62, 'outils.fortran.cc.delphi.mpi.opengl.net', '{"x":"Outils:\\u000bFortran, C\\/C++, Delphi, MPI, OpenGL, .NET,.","en":"Tools: Fortran, C \\/ C ++, Delphi, MPI, OpenGL, .NET,.","vn":"C\\u00f4ng c\\u1ee5: Fortran, C\\/C++, Delphi, MPI, OpenGL, .NET,."}'),
(63, 'modélisation.avancée', '{"x":"Mod\\u00e9lisation avanc\\u00e9e","en":"Advanced Modeling","vn":"M\\u00f4 h\\u00ecnh h\\u00f3a ti\\u00ean ti\\u1ebfn"}'),
(64, 'nos.équipes.de.rd.travaillent.au.quotidien.avec.des.grands.nom.du.cac40.pour.les.aider.à.développer.des.nouveaux.modèles.encore.plus.précis.et.encore.plus.complets.les.approches.multi.physiques.sont.plus.particulièrement.visées.interaction.fluidestru...', '{"x":"Nos \\u00e9quipes de R&D travaillent au quotidien avec des grands nom du CAC40 pour les aider \\u00e0 d\\u00e9velopper des nouveaux mod\\u00e8les encore plus pr\\u00e9cis et encore plus complets, les approches multi-physiques sont plus particuli\\u00e8rement vis\\u00e9es: interaction fluide\\/structure, m\\u00e9canique du vol, \\u00e9coulement diphasiques\\u2026 autant de domaines pour lesquels les forts couplages rendent les mod\\u00e8les num\\u00e9riques d\\u00e9licats","en":"Our R & D teams work on a daily basis with major names in the CAC40 to helping them to develop comprehensive new models. Multi-physical approaches are more specifically targeted: fluid-structure interaction, flight mechanics, two-phase flow ... so many areas where strong coupling make numerical models tricky","vn":"\\u0110\\u1ed9i ng\\u0169 nghi\\u00ean c\\u1ee9u & ph\\u00e1t tri\\u1ec3n c\\u1ee7a ch\\u00fang t\\u00f4i l\\u00e0m vi\\u1ec7c h\\u00e0ng ng\\u00e0y v\\u1edbi ch\\u1ec9 s\\u1ed1 CAC40 nh\\u1eb1m h\\u1ed7 tr\\u1ee3 s\\u1ef1 ph\\u00e1t tri\\u1ec3n c\\u00e1c m\\u00f4 h\\u00ecnh m\\u1edbi ch\\u00ednh x\\u00e1c h\\u01a1n v\\u00e0 \\u0111\\u1ea7y \\u0111\\u1ee7 h\\u01a1n, ti\\u1ebfp c\\u1eadn \\u0111a v\\u1eadt l\\u00fd h\\u01b0\\u1edbng t\\u1edbi m\\u1ee5c ti\\u00eau c\\u1ee5 th\\u1ec3 l\\u00e0: t\\u01b0\\u01a1ng t\\u00e1c l\\u01b0u ch\\u1ea5t \\/ k\\u1ebft c\\u1ea5u, c\\u01a1 ch\\u1ebf bay, d\\u00f2ng ch\\u1ea3y \\u0111a pha, m\\u00f4 h\\u00ecnh d\\u00f2ng ch\\u1ea3y r\\u1ed1i \\u2026 "}'),
(65, 'loptimation.et.la.précision.la.gestion.des.datas.ou.encore.le.développement.de.procédure.de.validation.automatique.est.au.cœur.de.nos.reflexions.nos.mathématiciens.sont.à.loeuvre', '{"x":"L\\u2019optimation et la pr\\u00e9cision, la gestion des datas ou encore le d\\u00e9veloppement de proc\\u00e9dure de validation automatique est au c\\u0153ur de nos reflexions.  Nos math\\u00e9maticiens sont \\u00e0 l\\u2019oeuvre!","en":"Optimization and accuracy, data management and the development of automatic validation procedures are at the heart of our reflections. Our mathematicians are at work!","vn":"T\\u1ed1i \\u01b0u h\\u00f3a v\\u00e0 chi ti\\u1ebft, qu\\u1ea3n l\\u00fd c\\u00e1c d\\u1eef li\\u1ec7u ho\\u1eb7c ph\\u00e1t tri\\u1ec3n c\\u00e1c quy tr\\u00ecnh x\\u00e1c nh\\u1eadn t\\u1ef1 \\u0111\\u1ed9ng l\\u00e0 m\\u1ee5c ti\\u00eau m\\u00e0 ch\\u00fang t\\u00f4i h\\u01b0\\u1edbng t\\u1edbi. C\\u00e1c nh\\u00e0 to\\u00e1n h\\u1ecdc c\\u1ee7a ch\\u00fang t\\u00f4i lu\\u00f4n \\u1edf \\u0111\\u00e2y n\\u1ed7 l\\u1ef1c h\\u1ebft m\\u00ecnh \\u0111\\u1ec3 th\\u1ef1c hi\\u1ec7n m\\u1ee5c ti\\u00eau!"}'),
(67, 'lexpertise.scientifique.de.nos.équipes.nous.permet.de.proposer.des.développements.de.codes.scientifiques.adaptés.à.la.demande.de.nos.clients.p.plavantage.est.pour.nos.partenaires.de.disposer.dun.logiciel.complet.intégrant.les.besoins.et.saffranchissa...', '{"x":"L\\u2019expertise scientifique de nos \\u00e9quipes nous permet de proposer des d\\u00e9veloppements de codes scientifiques adapt\\u00e9s \\u00e0 la demande de nos clients...<\\/p>\\n                    <p>L\\u2019avantage est pour nos partenaires de disposer d\\u2019un logiciel complet int\\u00e9grant les besoins et s\\u2019affranchissant d\\u2019achat de licences souvent co\\u00fbteuse.","en":"The scientific expertise of our teams allows us to propose development of scientific codes adapted to the demand of our customers ... The advantage is for our partners to have a complete software integrating the exact needs without purchasing expensive licenses.","vn":"V\\u1edbi \\u0111\\u1ed9i ng\\u0169 chuy\\u00ean gia k\\u1ef9 thu\\u1eadt cho ph\\u00e9p ch\\u00fang t\\u00f4i \\u0111\\u1ec1 xu\\u1ea5t ph\\u00e1t tri\\u1ec3n c\\u00e1c code k\\u1ef9 thu\\u1eadt ph\\u00f9 h\\u1ee3p v\\u1edbi y\\u00eau c\\u1ea7u c\\u1ee7a kh\\u00e1ch h\\u00e0ng.   Ch\\u00fang t\\u00f4i mang \\u0111\\u1ebfn cho kh\\u00e1ch h\\u00e0ng m\\u1ed9t ph\\u1ea7n m\\u1ec1m t\\u1ed5ng th\\u1ec3 ph\\u00f9 h\\u1ee3p v\\u1edbi nhu c\\u1ea7u v\\u00e0 gi\\u00fap kh\\u00e1ch h\\u00e0ng ti\\u1ebft ki\\u1ec7m \\u0111\\u01b0\\u1ee3c chi ph\\u00ed t\\u1eeb vi\\u1ec7c c\\u1ea5p ph\\u00e9p b\\u1ea3n quy\\u1ec1n ph\\u1ea7n m\\u1ec1m. "}'),
